            count = int(s[i])
            i += 1
            while i < n and s[i].isdigit():
                i += 1
            # Now count has the digit value, and i points to the next char
            if i < n and s[i].isalpha():
                result.append(s[i] * count)
                i += 1
        else:
            # Just append the character as is
            result.append(s[i])
            i += 1

    return ''.join(result)
